import "./Cats.scss";
import { Link } from "react-router-dom";

function Cats() {
  const { id, name, image } = props;
  return (
    <div className="list">
      <Link to={`/cats/${id}`}>
        <img src={image} />
        alt=""
      </Link>
    </div>
  );
}
export default Cats;
